import React, { Component, Fragment } from 'react';
import { Switch, Route } from 'react-router-dom'


class Routes extends Component {
    render() {
        return (
            <Switch>
                <Route exact path="/">
                    <p>Home</p>
                    <p>This is home page</p>
                </Route>
                <Route path="/genres" render={() => <p>Genres Page</p>} />
                <Route path="/albums" render={() => <p>Album Page</p>} />
                <Route path="/artists" render={() => <p>Artist Page</p>} />
                <Route path="/songs" render={() => <p>Song Page</p>} />

            </Switch>
        )
    }
}

export default Routes;
